import React, { useState, useEffect } from "react";
import { AppointmentEntry, columns } from "./columns"
import { DataTable } from "./data-table"

const getAppointments = async (): Promise<AppointmentEntry[]> => {
    // Fetch data from your API here.
    // const res = await fetch("http://localhost:8080/Appointments/getAppointments")
    // const data = await res.json()
    // return data
    return [
      { id: "test-1", 
        doctor: "Dr. John Doe", 
        reason_for_appointment: "Checkup",
        treatment: "None",
        date: new Date(),
        allergies: "None",
        conditions: "None",
        medications: "None",
        immunizations: "None",
        procedures: "None"},
      // Add more test data...
    ];
  };

  const DemoPage: React.FC = () => {
    const [data, setData] = useState<AppointmentEntry[]>([]);
  
    useEffect(() => {
      const fetchData = async () => {
        const appointments = await getAppointments();
        setData(appointments);
      };
      fetchData();
    }, []);

// export default async function DemoPage() {
//   const data = await getAppointments()

  return (
    <section className="text-gray-600 body-font">
    <div className="container mx-auto py-10">
      <DataTable columns={columns} data={data} />
    </div>
    </section>
  )
}

export default DemoPage;
